import logo from './logo.svg';
import './App.css';
import './nav_bar.js';
import Home from './Home'
import { BrowserRouter, Switch, Route } from 'react-router-dom'
import nav_bar from './nav_bar.js'
import Hello from './hello.js';

function App() {
  return (
    <BrowserRouter>
      <nav_bar/>
      <Switch>
        <Route path='/' component={Home}></Route>
      </Switch>
    </BrowserRouter>

  );
}

export default App;
